// Styles
import styles from "./layout.module.css";
import "./layout.module.css";

// Assets
import portrait from "../../assets/portrett_portefoelje.JPG";

// Components
import ContactPage from "../../components/Contact/ContactPage";
import TitleName from "../../components/NameAnimation/NameAnimation";

const HomePage = () => {
	return (
		<main id="home" className="homeMain">
			<section className="sectionLeft">
				<img src={portrait} alt="Portrett" />
			</section>

			<section className="sectionRight">
				<TitleName />
				<h3 className="titleSHeading">Junior Fullstack-utvikler</h3>
				<ContactPage />
			</section>
		</main>
	);
};

export default HomePage;
